const Persons = ({persons, searchTerm}) => {
    return (
        <ul>
            {persons.filter(person => 
                person.name.toLowerCase().includes(searchTerm.toLowerCase())).map(person =>
                <li 
                    key={person.name}>{person.name} {person.number}
                </li>
            )}
        </ul>
    )
}

export default Persons
